import React from 'react';
import Form from './form';

const Input = ({ val, onChange }) => {
    const onSubmit = e => {
        e.preventDefault();
    }

    return (
        <Form onSubmit={onSubmit}>
            <input
                type='submit'
                onChange={e => onChange(e.target.value)}
                placeholder='Add todo'
                value={val} />
        </Form>
    )
}

export default Input;
